import React from 'react';

const Weather = ({city, country, description}) => {
    return(
        <div>
            <h1>{city}, {country}</h1>
            <p>
                <li>{description}}</li>
                <li>current temp</li>
                <li>current humidity</li>
            </p>
        </div>
    );
};

export default Weather;
